import "./detailContent.css";
const DetailContent = (props) => {
  const { detail } = props;

  return (
    <div className="detail container">
      <div className="detail__someInfo d-flex">
        <div className="detail__someInfo--news">
          <h2 className="detail__name">{detail.name}</h2>
          <div className="detail__address"></div>
        </div>
        <div className="detail__someInfo--button"></div>
      </div>
    </div>
  );
};

export default DetailContent;
